import './App.css';

import { BrowserRouter, Routes, Route } from "react-router-dom";
import About from './components/About'
import Home from './components/Home';

function App() {


  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' exact element={<Home/>}/>
          <Route path='/about' exact element = {<About/>}/>
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
